My Sister's Hot Friend - Katie St. Ives 

Actors: Katie St. Ives, Johnny Castle

Release Date: January 28, 2011

Katie's friend can't help her study for the big test tomorrow, so she sends her brother, Johnny, over to give Katie a hand. When he arrives, Katie's mesmerized by his muscles and can't stay focused on her studies. Soon enough, Johnny's giving her a lesson in sex ed -- one that ends with his load in the back of her throat.
